const WriteNoteButton = () => {

    const writeNotes = () => {
        alert("Send a POST msg to Backend")
    }

    return (
        <>
        <input type='button' value='Write' onClick={writeNotes}/>
        </>
    )
  }

  export default WriteNoteButton
